{"17": ["Декорация очень симпатичная!Хорошо вписалась в аквариуме.я не знаю,кто пишет,что она без запаха,мне попалась,пипец какая вонючая!мыл с фери и дёгтерным мылом,запах остался всё равно,за это минус одна ⭐️ .надеюсь,что на рыбок это не повлияет!а так,покупкой очень доволен!Спасибо!", "2020-10-28T13:20:55Z", "коричневый", "0", 0, 1, 4, "Декорация для аквариума \"Коряга\"", "Deksi"], "20": ["Запах был действительно резкий, но после кипячения стал меньше. Поставила в аквариум, посадила растения. Использовала вместе с \"Бочкой\" этого же производителя. Ансамбль получился чудесный. Довольны всё и я, и рыбы. Спасибо за интересные декорации.", "2020-07-26T15:19:03.686451621Z", "коричневый", "0", 1, 0, 5, "Декорация для аквариума \"Коряга\"", "Deksi"], "24": ["Хорошее качество, запаха нет. Упакована отлично. Оказалась даже больше, чем я предполагала. В аквариуме смотрится очень реалистично.", "2020-03-11T13:29:18.964429064Z", "коричневый", "0", 2, 0, 5, "Декорация для аквариума \"Коряга\"", "Deksi"], "26": ["Очень реально смотрится коряга.", "2020-02-18T06:18:10.740807348Z", "коричневый", "0", 5, 0, 5, "Декорация для аквариума \"Коряга\"", "Deksi"]}
